// SPDX-License-Identifier: MIT LICENSE

pragma solidity ^0.8.17;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/draft-ERC20Permit.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract Frg is ERC20, ERC20Burnable, Ownable, ERC20Permit {
    using SafeMath for uint256;
    // mapping(address => bool) controllers;
    uint256 public constant MAXIMUMSUPPLY = 10_000_000 * 10 ** 18;
    bytes32 private constant _PERMIT_TYPEHASH =
        keccak256(
            "Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)"
        );

    constructor() ERC20("FRG Token", "FRG") ERC20Permit("FRG Token") {
        _mint(msg.sender, 7_000_000 * 10 ** 18);
    }

    function mint(address to, uint256 amount) external {
        // require(controllers[msg.sender], "Only controllers can mint");
        require(
            (totalSupply() + amount) <= MAXIMUMSUPPLY,
            "Minting would exceed total supply"
        );
        _mint(to, amount);
    }

    function testPermit(
        address owner,
        address spender,
        uint256 value,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public view returns (address) {
        uint256 nonce = nonces(owner);
        bytes32 structHash = keccak256(
            abi.encode(_PERMIT_TYPEHASH, owner, spender, value, nonce, deadline)
        );
        bytes32 hash = _hashTypedDataV4(structHash);
        address signer = ECDSA.recover(hash, v, r, s);
        return signer;
    }
}

contracts/erc20tokens/Usdt.sol.content:
// SPDX-License-Identifier: MIT LICENSE

pragma solidity ^0.8.17;
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Usdt is ERC20Burnable, Ownable {
    using SafeMath for uint256;

    mapping(address => bool) controllers;
    uint256 public constant MAXIMUMSUPPLY = 10_000_000 * 10 ** 18;

    constructor() ERC20("Usdt", "USDT") {
        _mint(msg.sender, 10_000_000 * 10 ** 18);
    }

    function mint(address to, uint256 amount) external {
        // require(controllers[msg.sender], "Only controllers can mint");
        require(
            (totalSupply() + amount) <= MAXIMUMSUPPLY,
            "Minting would exceed total supply"
        );
        _mint(to, amount);
    }

    function burnFrom(address account, uint256 amount) public override {
        if (controllers[msg.sender]) {
            _burn(account, amount);
        } else {
            super.burnFrom(account, amount);
        }
    }

    function addController(address controller) external onlyOwner {
        controllers[controller] = true;
    }

    // function removeController(address controller) external onlyOwner {
    //     controllers[controller] = false;
    // }

    function totalSupply() public view override returns (uint256) {
        return super.totalSupply();
    }
}

contracts/nfts/Pet.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

import "../erc20tokens/Frg.sol";
import "hardhat/console.sol";

error InsufficientFrgBalance();

contract Pet is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdCounter;
    Frg public immutable frgTokenAddress;
    uint256 public rate = 10 * 10 ** 18; // FRG tokens required per mint

    constructor(address _frgTokenAddress) ERC721("Pet", "PET") {
        frgTokenAddress = Frg(_frgTokenAddress);
    }

    // Safe mint
    function safeMint(string memory uri, address minter) public onlyOwner {
        // Burn Frg as the cost for minting
        frgTokenAddress.burnFrom(minter, rate);

        // Perform NFT minting
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(minter, tokenId);
        _setTokenURI(tokenId, uri);
    }

    // SafeMint with permit
    function safeMintWithPermit(
        string memory uri,
        uint256 deadline,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) public {
        if (frgTokenAddress.balanceOf(_msgSender()) < rate)
            revert InsufficientFrgBalance();
        frgTokenAddress.permit(
            _msgSender(),
            address(this),
            rate,
            deadline,
            v,
            r,
            s
        );
        // Burn Frg as the cost for minting
        frgTokenAddress.burnFrom(_msgSender(), rate);

        // Perform NFT minting
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(_msgSender(), tokenId);
        _setTokenURI(tokenId, uri);
    }

    // The following functions are overrides required by Solidity.

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
    }

    function _burn(
        uint256 tokenId
    ) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(
        uint256 tokenId
    ) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

